// --- ETAPA 2: RECEBER E LIMPAR OS TERMOS VINDOS DA IA ---
const outputDoLLM = items[0].json;
let textoDaIA = outputDoLLM.text;
const primeiroAbreColchete = textoDaIA.indexOf('[');
const ultimoFechaColchete = textoDaIA.lastIndexOf(']');

if (primeiroAbreColchete === -1 || ultimoFechaColchete === -1) {
  return [{ json: { "possiveis_produtos": [] } }]; 
}
const jsonLimpo = textoDaIA.substring(primeiroAbreColchete, ultimoFechaColchete + 1);
const termosDaIA = JSON.parse(jsonLimpo);


// --- ETAPA 3: BUSCAR PRODUTOS PARA CADA TERMO ---
const resultadosFinais = termosDaIA.map(item => {
  const termoDeBusca = item.termo;
  const quantidade = item.qtde;

  const palavrasChave = termoDeBusca.toLowerCase().normalize("NFD").replace(/[\u0300-\u036f]/g, "").split(' ');

  const produtosEncontrados = baseDeProdutos.filter(produto => {
    if (!produto.descricao) return false;
    const descricaoNormalizada = produto.descricao.toLowerCase().normalize("NFD").replace(/[\u0300-\u036f]/g, "");
    // Checa se TODAS as palavras-chave do termo estão na descrição
    return palavrasChave.every(chave => descricaoNormalizada.includes(chave));
  });

  return {
    "termo_pesquisado": termoDeBusca,
    "qtde": quantidade,
    "produtos_encontrados": produtosEncontrados
  };
});

// --- ETAPA 4: MONTAR O OUTPUT FINAL ---
const outputFinal = {
  "possiveis_produtos": resultadosFinais
};

return [{ json: outputFinal }];
